import {React,Iframe} from "react";
import './cnts/cnt.css';
import '../App.css';
import './pages.css';

const Main =() => {
    const iframe = '<iframe height="265" style="width: 100%;" scrolling="no" title="fx." src="https://www.figma.com/embed?embed_host=share&url=https%3A%2F%2Fwww.figma.com%2Ffile%2FdwJcOkbVxk5F0HqIv46HxW%2FDomi_Page">fx.</a> by ycw(<a href="https://codepen.io/ycw">@ycw</a>) on <a href="https://codepen.io">CodePen</a>.</iframe>'; 
    return(
        <div className="cnt_wrap">
            <div className="cnt">
                <div className="cnt_tit">이 홈페이지에 대하여..</div>
                <div className="tit_line"></div>
                <div className="cnt_sub_tit">HJY's Portfolio</div>
                <div className="cnt_sec">
                    <Iframe iframe={iframe} />
                </div>
            </div>
        </div>
    )
    
}

export default Main;
